/*Table structure for table `invoices` */

DROP TABLE IF EXISTS `invoices`;

CREATE TABLE `invoices` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `seller` int(11) DEFAULT NULL,
  `info` varchar(600) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `date` int(11) NOT NULL,
  `due_date` datetime DEFAULT NULL,
  `created` datetime DEFAULT NULL,
  `sent` timestamp NULL DEFAULT NULL,
  `client_type` int(11) NOT NULL,
  `ref_number` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `company_id` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `finvoice_address` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `finvoice_operator` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `company_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `contact_person` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `email` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `post_number` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `post_place` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `address1` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `address2` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `country` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `payment_method` int(11) NOT NULL,
  `ref_own` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `ref_client` varchar(35) COLLATE utf8mb4_unicode_ci NOT NULL,
  `desc` varchar(600) COLLATE utf8mb4_unicode_ci NOT NULL,
  `barcode` varchar(150) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `filename` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `total` decimal(9,2) DEFAULT NULL,
  `industry` varchar(5) COLLATE utf8mb4_unicode_ci NOT NULL,
  `delivery_method` int(11) DEFAULT NULL,
  `draft` int(11) DEFAULT NULL,
  `discarded` int(11) DEFAULT NULL,
  `status` int(11) DEFAULT NULL,
  `received` datetime DEFAULT NULL,
  ` modified` datetime DEFAULT NULL,
  `invoice_number` int(11) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=484 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

